function NavBar(props) {
  const { dataSource = [], settings } = props

  const [hook, setHook] = React.useState({})
  useActionCallback(props, $hook => setHook($hook))

  const getSetVal = key => {
    return chooseSetting(settings, defaultSettings, key)
  }

  const addPx = (val = 0) => {
    return `${val}px`
  }

  const boxBgColor = getSetVal('boxBgColor')
  const alignItems = getSetVal('alignItems')

  const itemSpace = getSetVal('itemSpace')
  const itemFontSize = getSetVal('fontSize')
  const fontColor = getSetVal('fontColor')
  const itemFontWight = getSetVal('fontWeight')
  const itemBgColor = getSetVal('itemBgColor')
  const borderRadius = getSetVal('borderRadius')
  const borderColor = getSetVal('borderColor')
  const textAlign = getSetVal('textAlign')

  const activeFontColor = getSetVal('activeFontColor')
  const activeBgColor = getSetVal('activeBgColor')
  const activeBorderColor = getSetVal('activeBorderColor')
  const border = getSetVal('border')

  const typeProps = getActionTypeProps(hook, 'navItemRender', {
    data: dataSource
  })

  return (
    <div
      style={{
        display: 'flex',
        width: '100%',
        height: '100%',
        gap: addPx(itemSpace),
        background: boxBgColor
      }}
    >
      {dataSource.map(item => {
        const isActive = item.active === true
        return (
          <span
            key={item.value}
            style={{
              display: 'flex',
              cursor: 'pointer',
              height: '100%',
              flex: '1',
              fontSize: addPx(itemFontSize),
              fontWeight: itemFontWight,
              color: isActive ? activeFontColor : fontColor,
              alignItems: alignItems,
              justifyContent: textAlign,
              ...(borderColor
                ? {
                    border: `${border}px solid ${
                      isActive ? activeBorderColor : borderColor
                    }`
                  }
                : {}),
              borderRadius: addPx(borderRadius),
              background: isActive ? activeBgColor : itemBgColor
            }}
            onClick={e => {
              typeProps.onClick && typeProps.onClick(e, item)
            }}
          >
            {item.title}
          </span>
        )
      })}
    </div>
  )
}

