export function genFixedCSS (column) {
  const left = column.fixed === 'left';
  const right = column.fixed === 'right';
  const css = {};
  if (left || right) {
    css.zIndex = 10;
    css.position = (left || right)
      ? 'sticky'
      : 'unset';
    if (left) {
      css.left = 0;
    }
    if (right) {
      css.right = 0;
    }
  }
  return css;
}

